function formatBName(rawname){
    var bname = wordwrap(rawname,16,'<br />');
    $('#selectBld').html(bname);
    
    switch(bname.split('<br />').length){
      case 1:  
        $('#selectBld').css('padding-top','22px');
        break;
      case 2:
        $('#selectBld').css('padding-top','14px');
        break;
      case 3:
        $('#selectBld').css('padding-top','8px');
        break;
      default:
        $('#selectBld').css('padding-top','0px');
        break;
    }
  }

  // http://james.padolsey.com/javascript/wordwrap-for-javascript/
  function wordwrap( str, width, brk, cut ) {
    brk = brk || '\n';
    width = width || 18;
    cut = cut || false; 
    
    if (!str) { return str; }

    var regex = '.{1,' +width+ '}(\\s|$)' + (cut ? '|.{' +width+ '}|.+$' : '|\\S+?(\\s|$)');

    return str.match( RegExp(regex, 'g') ).join( brk );
  }
